import uuid from 'uuid';

const classesData = [
  {
    id: uuid.v4(),
    title: 'Kettlebell',
    img: '/kettebell.jpg'
  },
  {
    id: uuid.v4(),
    title: 'OLYMPIC WEIGHTLIFTING',
    img: '/olymipic.jpg'
  },
  {
    id: uuid.v4(),
    title: 'CrossFit',
    img: '/gymnastic.jpg'
  },
  {
    id: uuid.v4(),
    title: 'Open lifting',
    img: '/free.jpg'
  },
  {
    id: uuid.v4(),
    title: 'yoga',
    img: '/yoga.jpg'
  },
  {
    id: uuid.v4(),
    title: 'boxing',
    img: '/boxing.jpg'
  },
  {
    id: uuid.v4(),
    title: 'begginer training',
    img: '/begginerTraining.png'
  },
  {
    id: uuid.v4(),
    title: 'hit cardio',
    img: '/hitCardio.jpg'
  },
  {
    id: uuid.v4(),
    title: 'strenght training',
    img: '/strenghtTraining.jpg'
  }
];

export default classesData;
